@VueComponent(template: r'''
<m-textfield
  v-on="$listeners"
  :theming="theming"
  ref="inner"
  :value="value"
  :disabled="disabled"
  :upgraded="upgraded"
  :fullWidth="fullWidth"
  :box="box"
  :outlined="outlined"
  :dense="dense"
  :focused="focused"
  :textarea="textarea"
  @input="_inputEmit(arguments[0])"
>
  <slot v-if="$slots.default"></slot>
  <template v-if="$slots.leadingIcon" slot="leadingIcon">
    <slot name="leadingIcon"></slot>
  </template>
  <template v-if="$slots.trailingIcon" slot="trailingIcon">
    <slot name="trailingIcon"></slot>
  </template>
  <template v-if="$slots.bottomLine" slot="bottomLine">
    <slot name="bottomLine"></slot>
  </template>
</m-textfield>''')
class MTextfield extends VueComponentBase with BaseMixin {
  static final input = VueEventSpec<String>('input');
  VueEventSink<String> inputSink;
  VueEventStream<String> inputStream;
  MTextfield() { _initialize(); }
  @override
  void lifecycleCreated() {
    inputSink = MTextfield.input.createSink(this);
    inputStream = MTextfield.input.createStream(this);
  }
  @ref
  dynamic inner;
  @prop
  String value = '';
  @prop
  bool disabled = false;
  @prop
  bool upgraded = false;
  @prop
  bool fullWidth = false;
  @prop
  bool box = false;
  @prop
  bool outlined = false;
  @prop
  bool dense = false;
  @prop
  bool focused = false;
  @prop
  bool textarea = false;
  @method
  _inputEmit(arg) => inputSink.add(arg);
}

